/* eslint-disable react-hooks/rules-of-hooks */
import './App.css';
import users from './users.json'
import { render } from '@testing-library/react';
import React from 'react';


function App() {

const data = users;

  return (
    <div className="App">
    {data.map(function (d, idx) {
      return (<li key={idx}>{d.name}</li> )
    })}
    </div>
  )
}


export default App;
